{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":7398307,"sourceType":"datasetVersion","datasetId":4301668}],"dockerImageVersionId":30618,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Case Study: How Does a Bike-Share Navigate Speedy Success?\n\nIn order to answer the key business questions, i will follow the steps of the data analysis process: ask, prepare, process, analyze, share, and act.\n\n#### Introduction\n\nThis project is a Google Data Analytics Capstone Project on Coursera, designed to reinforce the analytical skills gained throughout the course duration. For this exercise, I utilize a publicly available data from Cyclistic, a bike share (fictional) company based in the city of Chicago, IL, USA. Featuring 5800 bicycles and 692 docking station. to uncover key insights, pattern and trends on the bike rental service usage and communicate the findings in an easy, engaging and persuasive way to the key stakeholder.\n\n#### Stakeholders\n\n⦁ Lily Moreno: The director of marketing\n\n⦁ Cyclistic marketing analytics team\n\n⦁ Cyclistic executive team\n\n## ASK\n\n#### Business Task\n\nThis analysis's main goals are to optimize the overall business performance, with a specific focus on leveraging data analytics to increase revenue derived from the transition of non-subscribed 'casual' riders into annual members 'subscriber'. we aim to uncover distinctions in the utilization patterns of Cyclistic bikes between casual riders and annual members. These insights will serve as the foundation for our team to formulate a new marketing strategy geared towards the conversion of casual riders into annual members.\n\n## Prepare\n\n#### Data Source Description\n\nThis report made use of data collected in 12 months (August 2022 - July 2023) for detailed data analysis to complete this case study. To download the data, please use this [link](https://divvy-tripdata.s3.amazonaws.com/index.html). This data was made public by Motivate International Inc, under this [license](https://divvybikes.com/data-license-agreement). Due to data privacy issues, personal information has been removed or encrypted. i Ensure the \"Divvy bikeshare\" dataset integerity by checking if the data ROCCC.\n\n#### Dataset\n\nThe dataset consist of 13 columns and a total of 5723606 rows. Here's an overview of the columns:\n\n**ride_id:** a unique ID per ride\n\n**rideable_type:** the type of bicycle used\n\n**started_at:** the date and time at which bicycle was checked out\n\n**ended_at:** the date and time at which bicycle was checked in\n\n**start_station_name:** the name of the station at the start of the trip\n\n**start_station_id:** a unique identifier for the start station\n\n**end_station_name:** the name of the station at the end of the trip\n\n**end_station_id:** a unique identifier for the end station\n\n**Start_lat:** the latitude of the start station\n\n**start_lng:** the longitude of the start station\n\n**end_lat:** the latitude of the end station\n\n**end_lng:** the longitude of the end station\n\n**member_casual:** this field indicates whether the rider type is a member or casual member\n\n#### Data Interigity(ROCCC)\n\n**Reliable:** data is reliable and accurate being collected by a credible source using advanced data collection technology\n\n**Original:** Primary data source, the company Cyclistic gathers this data first-hand.\n\n**Comprehensive:** The dataset has more than 5 million complete data entries. With the available data we are able to compare the two groups 'annual members & casual members', but not the preference that lead to their choice on what product/services to opt for.\n\n**Current:** Data is up-to-date as it includes data from the past 12 months.\n\n**Cited:** Yes, The data is authorized under license.\n\n## Process\n\n#### R Programming\n\nR programming is the data analysis tool of my choice for this project, and preferable to spreadsheet due to the raw amount of data in this data set. R is an open-source programming language and free software environment for statistical computing and graphics. R has a wide range of tools available and can handle massive amounts of data with ease. I imported and load the data into RStudio.","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle"}},{"cell_type":"code","source":"# Setting up my r environment and Loading packages\n\nlibrary(tidyverse)\nlibrary(ggplot2)\nlibrary(janitor)\nlibrary(lubridate)\nlibrary(readr)\nlibrary(skimr)\nlibrary(dplyr)\nlibrary(tidyr)\nlibrary(gt)\nlibrary(farver)\nlibrary(plotrix)","metadata":{"execution":{"iopub.status.busy":"2024-01-16T05:41:37.404196Z","iopub.execute_input":"2024-01-16T05:41:37.444425Z","iopub.status.idle":"2024-01-16T05:41:38.728028Z"},"trusted":true},"execution_count":2,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u0