ember is beneficial. Campaigns should be placed at the peak months of the year especially during hot seasons.\nAdvert should also focus on electric bike and classic bikes due frequency of bike usage.\n\n#### Conclusion\nNote : All ride ids are unique so we cannot conclude if the same rider taken several rides. More rider data needed for further analysis\n\n* Additonal data that could expand scope of analysis\n\n* Pricing details for members and casual riders - Based on this data, we might be to optimize cost structure for casual riders or provide discounts without affecting the profit margin.\n* Address/ neighborhood details of members to investigate if there are any location specific parameters that encourage membership.Way to determine a recurring bike user using payment information or any personal identification.","metadata":{}}]}